	//   syntax: events_$alias ($alias can be [0-9A-Za-z_])
	//   attributes: the following attributes can be used
	//     artifact_id: int64(Execution only), execution_id: int64(Artifact only),
	//     type: ENUM, milliseconds_since_epoch: int64
