	//    - type_id = 5
	//    - type = 'my_type_name'
	//    - name = 'foo'
	//    - type = 'bar' AND name LIKE 'foo%'
	//    - NOT(create_time_since_epoch < 1 OR last_update_time_since_epoch < 1)
	//
	// b) to filter artifacts' uri
	//    - uri = 'exact_path_string'
	//    - uri LIKE 'path_like_this%'
	//    - uri IS NOT NULL
